				#Fields from mysql plain logs
				mutate {
					rename => { "timestamp" => "[logx][mysql][timestamp]" }
					rename => { "thread" => "[logx][mysql][thread]" }
					rename => { "pid" => "[logx][mysql][pid]" }
					rename => { "label" => "[logx][mysql][label]" }
					rename => { "err_code" => "[logx][mysql][err_code]" }
